import styled from "styled-components";

const TitleOfComponent=styled.div`
    font-weight:600;
    margin-bottom:10px;
`

const SpanOfComponent=styled.span`
    font-weight:300;
`
var exchanges_arr=[]
const detailtoSHow=(markets)=>{
    console.log(markets)
    var i=0;
    markets.map(exc=>{ 
      console.log(i)

        const arra_=(
            <div key={i}>
                <h3>{exc.exchange_name}</h3> 
            </div>
        )
        i=i++;
        exchanges_arr.push(arra_);
    })
}
const MarketPresenter = ({markets,loading}) =>{
    if(!loading){
        detailtoSHow(markets);
    }   
   return(
      <div>{exchanges_arr}</div>
   )


};

export default MarketPresenter;
